const descriptionDiv = document.createElement('div');
descriptionDiv.style.webkitTextFillColor = "#FFFFFF";
descriptionDiv.innerHTML = 'Reading data & Doing Force Atlas 2......';


const container = document.getElementById('container');
container.appendChild(descriptionDiv);
const width = 1500;
const height = 720;
container.style.background = '#000';

const colors = ['#28f227', '#8fce00', '#6aa84f', '#f5e038', '#a5dc28', '#6aa84f', '#1bdc6e'];
const beginColor = '#5b8c00'; // green
const endColor = '#ff4d4f'; // red

const nodes = data.nodes;
const edges = data.edges;
const nodeMap = new Map();
    const clusterMap = new Map();
    let cidx = 0;
    nodes.forEach(function (n) {
      nodeMap.set(n.id, n);
      let region = n.labelk.split(' ');
      if (n.labelk === 'East Asia') region = n.labelk;
      else region = region[region.length - 1];

      if (clusterMap.get(region) === undefined) {
        clusterMap.set(region, cidx);
        cidx++;
      }
      const clusterId = clusterMap.get(region);
      const color = colors[clusterId % colors.length];
      n.style = {
        color,
        fill: color,
        stroke: '#666',
        lineWidth: 0.6,
      };
      n.cluster = clusterId;
      n.importValue = 0;
      n.degree = 0;
      n.exportValue = 0;
    });
edges.forEach(function (e) {
  if (e.value === '') e.value = 0;
  const v = 1;
  nodeMap.get(e.source).degree += v;
  nodeMap.get(e.target).degree += v;

  nodeMap.get(e.source).exportValue += v;
  nodeMap.get(e.target).importValue += v;
});

mapValueToProp(nodes, 'degree', 'size', [20, 200]);
const graph = new G6.Graph({
  container: 'container',
  width,
  height,
  layout: {
    type: 'force',
    alphaDecay: 0.05,
    alpha: 0.3,
    alphaMin: 0.1,
    center: [850, 555],
    linkDistance: 100,
    clusterNodeStrength: -2,
    //preventOverlap: true
    
  },
 
      defaultNode: {
        type: 'circle',
        //size: 20,
      },
      defaultEdge: {
        type: 'quadratic',
      },
      modes: {
        default: [
          {
            type:'zoom-canvas',
            //sensitivity: 10,
          }
        ,
          'drag-node',
          'drag-canvas',
          {
            type: 'tooltip',
            formatText: function formatText(model) {
              let name = '';
              let countries = '';
              if (model.labelk) name = model.labelk + '<br/>';
              //if (model.countries) countries = '<br/>Number of Countries: ' + model.countries;
              const text = `Label: ${name} Out degree: ${model.exportValue} In degree: ${model.importValue}`;
              return text;
            },

            shouldUpdate: function shouldUpdate() {
              return true;
            },
          },
        ],
      },
});

graph.on('afterlayout', function () {
  descriptionDiv.innerHTML = 'Done!';
});
   

graph.data({
  nodes: data.nodes,
  edges: data.edges.map(function (edge, i) {
    edge.id = 'edge' + i;
    return Object.assign({}, edge);
  }),
});
graph.render();

   

    if (typeof window !== 'undefined')
      window.onresize = () => {
        if (!graph || graph.get('destroyed')) return;
        if (!container || !width || !height) return;
        graph.changeSize(width, height);
      };

      function mapValueToProp(items, valueName, propName, range) {
        const valueRange = [9999999999, -9999999999];
        items.forEach(function (n) {
          if (n[valueName] > valueRange[1]) valueRange[1] = n[valueName];
          if (n[valueName] < valueRange[0]) valueRange[0] = n[valueName];
        });
        const valueLength = valueRange[1] - valueRange[0];
        const rLength = range[1] - range[0];
        const propNameStrs = propName.split('.');
        if (propNameStrs[0] === 'style' && propNameStrs.length > 1) {
          items.forEach(function (n) {
            if (n.style === undefined) n.style = {};
            n.style[propNameStrs[1]] =
              (rLength * (n[valueName] - valueRange[0])) / valueLength + range[0];
          });
        } else {
          items.forEach(function (n) {
            n[propNameStrs[0]] = (rLength * (n[valueName] - valueRange[0])) / valueLength + range[0];
          });
        }
      }





